import React from 'react';
import styled from 'styled-components';

const Footer = styled.footer`
	margin-bottom: 5px;
	text-align: center;
`;

const NavItem = styled.a`
	display: inline-block;
	cursor: pointer;
`;

const NavItemSpacer = styled.span`
	padding-left: 90px;
`;

const NavCopy = styled.div`
	font-family: 'cera_proregular';
	color: #455051;
`;



const footer = (props) => (
	<Footer>
		<NavItem>
			<img src="assets/images/listen.png" alt="listen"/>
			<NavCopy>Listen</NavCopy>
		</NavItem>
		<NavItemSpacer />
		<NavItem>
			<img src="assets/images/watch.png" alt="watch"/>
			<NavCopy>Watch</NavCopy>
		</NavItem>
		<NavItemSpacer />
		<NavItem>
			<img src="assets/images/price.png" alt="price"/>
			<NavCopy>Price</NavCopy>
		</NavItem>
	</Footer>
)

export default footer;
